 страницы переопределяет этот шаблон при отображении записей на главной странице.', 'publish', 'closed', 'closed', '', 'home', '', '', '2023-06-09 10:30:57', '2023-06-09 07:30:57', '', 0, 'https://soldatenko.xn--80ahdri7a.site/2023/06/09/home/', 0, 'wp_template', '', 0),
