(175, 1, '2023-06-13 10:16:35', '2023-06-13 07:16:35', '<div class=\"form_1\">\r\n<p>Введите ваши данные для доставки</p>\r\n\r\n<label>Ваше имя \r\n[text* text-767 class:class_name placeholder \"Ваше имя\"]</label>\r\n\r\n<label> Ваш телефон\r\n[tel* tel-343 class:class_telephone placeholder \"Ваш телефон\"]  </label>\r\n\r\n<label>Ваш email \r\n[email* email-626 class:class_email placeholder \"Ваш email\"]</label>\r\n\r\n<label> Ваш адрес\r\n[text* text-355 class:class_adres placeholder \"Ваш адрес\"] </label>\r\n\r\n<label> Комментарий к заказу (не обязательно)\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Отправить\"]\r\n</div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@soldatenko.xn--80ahdri7a.site>\nsoldatenkojulia@icloud.com\nОт: [your-name] [your-email]\r\nТема: [your-subject]\r\n\r\nСообщение:[your-message]\r\nИмя: [your-name]\r\nТелефон: [tel-343]\r\nEmail: [your-email]\r\nКомментарий: [text-355]\r\n[your-message]\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\nReply-To: soldatenkojulia@icloud.com\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@soldatenko.xn--80ahdri7a.site>\n[your-email]\nСообщение:\r\n[your-message]\r\n\r\n-- \r\nЭто сообщение отправлено с сайта [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nСпасибо за Ваше сообщение. Оно успешно отправлено.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nОдно или несколько полей содержат ошибочные данные. Пожалуйста, проверьте их и попробуйте ещё раз.\nПри отправке сообщения произошла ошибка. Пожалуйста, попробуйте ещё раз позже.\nВы должны принять условия и положения перед отправкой вашего сообщения.\nВажно заполнить это поле.\nВ это поле вставлен слишком большой объем данных.\nВ это поле вставлен слишком малый объем данных.\nПри загрузке файла произошла неизвестная ошибка.\nВам не разрешено загружать файлы этого типа.\nЗагруженный файл слишком большой.\nПри загрузке файла произошла ошибка.\nВведите дату в формате ГГГГ-ММ-ДД.\nВ это поле введена слишком ранняя дата.\nВ это поле введена слишком поздняя дата.\nВведите число.\nВ это поле введено слишком маленькое число.\nВ это поле введено слишком большое число.\nНеверный ответ на проверочный вопрос.\nВведите адрес электронной почты.\nВведите URL.\nВведите номер телефона.', 'Без названия', '', 'publish', 'closed', 'closed', '', '%d0%b1%d0%b5%d0%b7-%d0%bd%d0%b0%d0%b7%d0%b2%d0%b0%d0%bd%d0%b8%d1%8f-3', '', '', '2023-06-13 10:29:51', '2023-06-13 07:29:51', '', 0, 'https://soldatenko.xn--80ahdri7a.site/?post_type=wpcf7_contact_form&#038;p=175', 0, 'wpcf7_contact_form', '', 0),
